import React from "react";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import "./2Camp.css";

function Campaign(props) {

  const { setStep, userData, setUserData } = props;

  return (
    <div className="main">
      <label className="leftBody">
        <h2> Let's talk about your campaign</h2>
        <form className="formi">
          <label className="inputs">
            <h4>Fill-in the form the below</h4>
            <div>
              <TextField
                type="text"
                value={userData["campaign"]}
                onChange={(e) =>
                  setUserData({ ...userData, campaign: e.target.value })
                }
                placeholder="CAMPAIGN NAME"

                variant="outlined"
                size="small"
                fullWidth={true}
                margin="dense"
              />
            </div>
            <div>
              <TextField
                type="date"
                value={userData["startdate"]}
                onChange={(e) =>
                  setUserData({ ...userData, startdate: e.target.value })
                }

                size="small"
                fullWidth={true}
                margin="dense"
                variant="outlined"
              />
            </div>
            <div>
              <TextField
                type="date"
                value={userData["enddate"]}
                onChange={(e) =>
                  setUserData({ ...userData, enddate: e.target.value })
                }

                size="small"
                fullWidth={true}
                margin="dense"
                variant="outlined"
              />
            </div>
            <div>
              <TextField
                value={userData["clients"]}
                onChange={(e) =>
                  setUserData({ ...userData, clients: e.target.value })
                }
                type="text"
                placeholder="ENTER 5 POTENTIAL CLIENTS (NAME OR WEBSITES)"

                size="small"
                fullWidth={true}
                margin="dense"
                variant="outlined"
              />
            </div>
          </label>
        </form>
      </label>
      <div className="sola">
        <Button size="large" onClick={() => setStep(1)}>
          Previous{" "}
        </Button>

        <Button size="large" onClick={() => setStep(3)}>
          Next{" "}
        </Button>
      </div>
    </div>
  );
}

export default Campaign;
